import React from 'react'
import img19 from '../img/img19.png'

function ContainerFAQs() {
  return (
    <div className='ContainerFAQs'>
        <h1>Erorr</h1>
        <p>Trang bạn tìm kiếm hiện đang bảo trì vui lòng quay lại sau !!</p>
        <img src={img19} alt='erorr'/>
    </div>
  )
}

export default ContainerFAQs
